import React from "react";
import TelaCadastro from "./components/TelaCadastro";
import TelaListaUsuarios from "./components/TelaListaUsuarios"


export default class App extends React.Component {
  state = {
    telaAtual: "cadastro"
  }

  render() {
    return (
      <div>
        <TelaCadastro />
        <TelaListaUsuarios />
      </div>
    )
  }
}
